embedfield:
MongoDB element on nested schemas and return only that element<p>i have this Schema for a simple twitter app </p>

<pre><code>const userSchema = new Schema ({
    loginInfo: {
        username: String,
        email: String,
        password: String 
    },
    tweets: [{
        content: String,
        likes: Number,
        comments: [{
            owner: String,
            content: String,
            likes: Number
        }]
    }],
    followers: [String],
    following: [String]
})
</code></pre>

<p>and i want to make endpoint that return only the tweet that has the same <strong>_id</strong> that has been given as a params on the URL ..
I made that solution below and its working correctly but i believe there is a much better solution than this ..</p>

<pre><code>const handleTweet = (User) =&gt; (req,res) =&gt; {
    const { id } = req.params;
    let theTweet = [];
    User.findOne({ "tweets._id": id})
    .then(user =&gt; {
        user.tweets.forEach(tweet =&gt; {
            if(tweet._id.toString() === id)
                return theTweet.push(tweet)
        })
        res.json(theTweet)
    })
    .catch(err =&gt; res.json(err))
}

module.exports = handleTweet;
</code></pre>

<p>One more question : <strong>Is it better to make nested schemas like this or making a different models for each schema (in this case schema for User and another one for Tweets) ?</strong></p>

