How can I increment nested dynamic values?<p>I have a database that's loosely created which has a key called <code>website</code>. Within this <code>website</code> object I will have multiple objects, one for each dynamically created website. An example of how the database could look would be</p>

<pre><code>website: {
    google.com: {
        count: 19,
        like: {huge: 9, normal: 10},
        follow: {big: 11, small: 8}
    },
    facebook.com: {
        count: 1,
        like: {huge: 1},
        follow: {big: 1}
    }
}
</code></pre>

<p>So websites is initially an empty object and the more that happens, more random websites will be added (google, facebook being the example)</p>

<p>Now, I want the values inside incremented by 1 when I get a hit for those values, so for example</p>

<pre><code>User.findByIdAndUpdate({"_id": id}, {
website: {
    [query.name]: { $inc : { //query.name is the dynamic name that'll be given
        count: 1, //I want this count value incremented by one
        like: {
            [query.like]: 1 //query.like would be either huge or normal or something that's not available yet, in which case it would be created with a value of 1. If it exists I want the value incremented by one.
        },
        follow: {
            [query.follow]: 1 //query.follow would be either big or small or something that's not available yet, in which case it would be created with a value of 1. If it exists I want the value incremented by one.
        }
    }}
}
}, function(err, result){
    if (err) {
        console.log(err);
    } else {
        console.log(result);
    }
});
</code></pre>

<p>But this isn't working, it gives me an error saying "Error: The dollar ($) prefixed field '$inc' in 'website.[dynamic website name].$inc' is not valid for storage."</p>

<p>I tried putting the $inc in a few other places but I got about the same message.</p>

<p>Any ideas? :(</p>

