embedfield:
mongodb aggregate by month+date and sort it<p>I created this aggregate operation to return a list of list of orders, for each month. That is, something like this:</p>

<pre><code>month1: [orders],
month2: [orders],
...
</code></pre>

<p>However, I wanted it sorted from most recent to least recent month. You can see that my group is the concatenation month+year with a catch. If I simply did month+year, then sorting things would not work:</p>

<pre><code>MYYYY
12020
22020
...
92020
102020
</code></pre>

<p>as you can see, when we reach month 10, the order is broken. The catch was to add <code>10</code> to every month, so we end up with </p>

<pre><code>MYYYY
112020
122020
...
192020
202020
212020
222020
102021
</code></pre>

<p>for which ordering works, but then breaks at the next year, 2021.</p>

<p>So how can I order by month+year in a way that I can sort but in a way that I can also display things beautifully in the response? Something easy to parse.</p>

<pre><code>        r = await Order.aggregate([
            {
                $match: {
                    launchDate: { "$gte": new Date(req.query.minDate), "$lte": new Date(req.query.maxDate) },
                    withdrawer: { $regex: utils.diacriticSensitiveRegex(req.query.withdrawer), $options: 'i' },
                    deleted: false
                }
            },
            {
                $sort: {
                    launchDate: 1
                }
            },
            {
                $group: {
                    _id: {
                        $concat: [
                            {
                                $toString: {
                                    $year: "$launchDate"
                                }
                            },
                            {
                                $toString: {
                                    $add: [{ $month: "$launchDate" }, 10]
                                }
                            }
                        ]
                    },
                    withdraws: {
                        $push: "$$ROOT"
                    }

                }
            },
            {
                $sort: {
                    _id: -1
                }
            },
            {
                $addFields: {
                    dateRange: "$_id"
                }
            },
            {
                $skip: skip
            },
            {
                $limit: perPage
            }
        ]);
</code></pre>

